      if(IP){
        editarLista({busqueda:txtbusqueda,IP:IP});
        setEstado("validado");
      }
  },[IP] )



  const  obtenerDireccionIP = async(busqueda) => {
    try {
      const response = await fetch(`http://ip-api.com/json/${busqueda.replace("https://", "").replace("http://", "").replace("www.", "")}`);
      const data = await response.json();
      console.log(data )
      if (data.status === 'success') {

        CambiarIP({IP:    data.query,
                  websiteName: txtbusqueda,
                  country:data.country,
                  isp:    data.isp,
                  org:    data.org,
                  lat:    data.lat,
                  lon:    data.lon,
                  })
        return;

      } else {
        console.error('Error al obtener la direcci贸n IP:', data.message);
        setEstado("error")
        return null;
      }
    } catch (error) {
      console.error('Error al obtener la direcci贸n IP:', error);
      setEstado("error")
      return null;
    }
  }
  const DnsLookup =  async(url) => {

    var myHeaders = new Headers();
    myHeaders.append("key", "0D3C91D418AD36C7DB93D2B80AC06229");

    try{
      const response = await axios.get(
        `https://api.savepage.io/v1/?key=09e97082bee4babfd4ee0d3f1cdae752&q=${url.replace("https://", "").replace("http://", "").replace("www.", "")}`)

      console.log(response);
      const data = response.data


    }
    catch(e){
      console.log(e)
    }
  }

    return(
      <>
        <Form onSubmit={submitForm}>
            <div className="row">
              <div className="col-md-8 col-sm-12">
              <InputGroup className="mb-3">
              <InputGroup.Text >Web a buscar:</InputGroup.Text>
                <Form.Control
                  type="text"
                  placeholder="ingrese una url para escanear"
                  name="txtbusqueda"
                  onChange={handleChange}
                  value={txtbusqueda}/>
              </InputGroup>
            </div>
            <div className="col-md-4 col-sm-12"  >
                <Button type="submit" variant="primary">Buscar</Button>
              </div>
            </div>
        </Form>
        {estado ==="error"? 
                    <h2> la pagina ingresada es invalida</h2>
              : estado==="validado" && IP !== ''? 
                    <div className="row">                   
                      <div className="col-md-6">
                      <Table striped bordered hover size="sm">
                                <thead>
                                  <tr>
                                  <th colSpan={2}>{IP}</th>
                                  </tr>
                                </thead>
                                <tbody>
                                  <tr>
                                    <td>Proveedor</td>
                                    <td>{isp}</td>
                                  </tr>
                                  <tr>
                                    <td>organizacion</td>
                                    <td>{org}</td>
                                  </tr>
                                  <tr>
                                    <td>Pais</td>
                                    <td>{country}</td>
                                  </tr>
                                </tbody>
                              </Table>
                      </div>
                      <div className="col-md-6">
                        <MapView ip={IP} 
                                lat={lat}
                                lon={lon} /> 
                      </div>
                    </div>

                    :null
        }
      </>
      )
}

export default DnsSearcher;
